a:260:{i:0;a:1:{s:2:"id";s:19:"2390963742658563519";}i:1;a:1:{s:10:"short_code";s:11:"CEuaNsoAI2_";}i:2;a:1:{s:12:"created_time";i:1599245110;}i:3;a:1:{s:7:"caption";s:1786:"Sri Nisargadatta Maharaj 
Neti Neti

You cannot possibly say that you are what you think yourself to be! Your ideas about yourself change from day to day and from moment to moment. Your self-image is the most changeful thing you have. It is utterly vulnerable, at the mercy of a passer by. A bereavement, the loss of a job, an insult, and your image of yourself, which you call your person, changes deeply.
To know what you are you must first investigate and know what you are not. And to know what you are not you must watch yourself carefully, rejecting all that does not necessarily go with the basic fact: ‚ÄòI am‚Äô. The ideas: I am born at a given place, at a given time, from my parents and now I am so-and-so, living at, married to, father of, employed by, and so on, are not inherent in the sense ‚ÄòI am‚Äô. Our usual attitude is of ‚ÄòI am this‚Äô.
Separate consistently and perseveringly the ‚ÄòI am‚Äô from ‚Äòthis‚Äô or ‚Äòthat‚Äô, and try to feel what it means to be, just to be, without being ‚Äòthis‚Äô or ‚Äòthat‚Äô. All our habits go against it and the task of fighting them is long and hard sometimes, but clear understanding helps a lot.
The clearer you understand that on the level of the mind you can be described in negative terms only, the quicker you will come to the end of your search and realise your limitless being.

